import React from 'react';
import {Box, Spinner} from "native-base";

const WRIndexLoadingIndicator = () => {
    return (
        <Box
            bg='#1C1C1E'
            flex={1}
            borderRadius={'24px'}
        >
            <Spinner color="emerald.500"/>
        </Box>
    );
};

export {WRIndexLoadingIndicator};
